import React from 'react';

// Componente funcional para HubSpot
export const HubspotIntegration = ({ setIntegrationParams }) => {
  const handleConnect = () => {
    window.location.href = "/integrations/hubspot/authorize";
  };

  return (
    <button 
      onClick={handleConnect}
      style={{ marginTop: "20px", padding: "10px" }}
    >
      <img 
        src="https://cdn.iconscout.com/icon/free/png-256/hubspot-3521467-2944922.png" 
        width="20" 
        alt="HubSpot" 
      />
      Connect to HubSpot
    </button>
  );
};

// Objeto de configuración para el Autocomplete
export const HubspotConfig = {
  name: "HubSpot",
  slug: "hubspot",
};
